import React from 'react';
import moment from 'moment';
class Employee extends React.Component {
  state = {
    employees: []
  }
  componentDidMount() {
    // const startDate = new Date(this.props.startDate);
    // const endDate = new Date(this.props.endDate);
    // this.setState({
    //   employees: this.props.employees.filter(function(employee) {
    //     const employeeDOB = new Date(employee.dob);
    //     // checking if employeeDOB is in between startDate and endDate
    //     if (employeeDOB.getTime() > startDate.getTime() && employeeDOB.getTime() < endDate.getTime()) {
    //       return true;
    //     }
    //     return false;
    //   })
    // })

    this.setState({
      employee: this.props.employees,
    })
  }
  render() {
    console.log(this.props);
    return (
      <table className="table">
        <thead>
          <tr>
            <th scope="col">Image</th>
            <th scope="col">Name</th>
            <th scope="col">Phone</th>
            <th scope="col">Email</th>
            <th scope="col">DOB</th>
          </tr>
        </thead>
        <tbody>
          {this.state.employees.map(employee => (
            <tr key={employee.id.value}>
              <td><img alt="employee pic" src={employee.picture.thumbnail}></img></td>
              <td>{employee.name.first} {employee.name.last}</td>
              <td>{employee.phone}</td>
              <td>{employee.email}</td>
              <td>{moment(employee.dob.date.slice(0, 10)).format("MM-DD-YYYY")}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  }
}
export default Employee;
